import "../ToDoList.css";

const ToDo = ({todo}) => {

  const [isOpen, setIsOpen] = useState(false);

  const openOrClose = () => {
    isOpen ? setIsOpen(false) : setIsOpen(true);
  }

  return (
    <div className={`Card ${isOpen ? 
      'Card-Input' : todo.task==null ? 
        'Empty-Card' : 'Card'}`}>

    </div>


  );
};
/** 
*/
export default ToDo;

